const zigbeeHerdsmanConverters = require('zigbee-herdsman-converters');
const zigbeeHerdsmanUtils = require('zigbee-herdsman-converters/lib/utils');


const exposes = zigbeeHerdsmanConverters['exposes'] || require("zigbee-herdsman-converters/lib/exposes");
const ea = exposes.access;
const e = exposes.presets;
const fz = zigbeeHerdsmanConverters.fromZigbeeConverters || zigbeeHerdsmanConverters.fromZigbee;
const tz = zigbeeHerdsmanConverters.toZigbeeConverters || zigbeeHerdsmanConverters.toZigbee;

const ptvo_switch = (zigbeeHerdsmanConverters.findByModel)?zigbeeHerdsmanConverters.findByModel('ptvo.switch'):zigbeeHerdsmanConverters.findByDevice({modelID: 'ptvo.switch'});
fz.legacy = ptvo_switch.meta.tuyaThermostatPreset;
fz.ptvo_on_off = {
  cluster: 'genOnOff',
  type: ['attributeReport', 'readResponse'],
  convert: (model, msg, publish, options, meta) => {
      if (msg.data.hasOwnProperty('onOff')) {
          const channel = msg.endpoint.ID;
          const endpointName = `l${channel}`;
          const binaryEndpoint = model.meta && model.meta.binaryEndpoints && model.meta.binaryEndpoints[endpointName];
          const prefix = (binaryEndpoint) ? model.meta.binaryEndpoints[endpointName] : 'state';
          const property = `${prefix}_${endpointName}`;
	  if (binaryEndpoint) {
            return {[property]: msg.data['onOff'] === 1};
          }
          return {[property]: msg.data['onOff'] === 1 ? 'ON' : 'OFF'};
      }
  },
};

// Copied from fromZigbee.js
// The standard converter does not append the endpoint number

fz.ptvo_illuminance = {
    cluster: 'msIlluminanceMeasurement',
    type: ['attributeReport', 'readResponse'],
    options: [exposes.options.calibration('illuminance', 'percentual'), exposes.options.calibration('illuminance_lux', 'percentual')],
    convert: (model, msg, publish, options, meta) => {
        // multi-endpoint version based on the stastard onverter 'fz.illuminance'
        // DEPRECATED: only return lux here (change illuminance_lux -> illuminance)
        const illuminance = msg.data['measuredValue'];
        const illuminanceLux = illuminance === 0 ? 0 : Math.pow(10, (illuminance - 1) / 10000);
        const multiEndpoint = model.meta && model.meta.hasOwnProperty('multiEndpoint') && model.meta.multiEndpoint;
        const property1 = (multiEndpoint)? zigbeeHerdsmanUtils.postfixWithEndpointName('illuminance', msg, model, meta): 'illuminance';
        const property2 = (multiEndpoint)? zigbeeHerdsmanUtils.postfixWithEndpointName('illuminance_lux', msg, model, meta): 'illuminance_lux';
        return {
            [property1]: zigbeeHerdsmanUtils.calibrateAndPrecisionRoundOptions(illuminance, options, 'illuminance'),
            [property2]: zigbeeHerdsmanUtils.calibrateAndPrecisionRoundOptions(illuminanceLux, options, 'illuminance_lux'),
        };
    },
};



const device = {
    zigbeeModel: ['MIKE.CC2530'],
    model: 'MIKE.CC2530',
    vendor: 'MIKE',
    description: 'Russia',
    fromZigbee: [fz.ignore_basic_report, fz.temperature, fz.ptvo_illuminance,],
    toZigbee: [tz.ptvo_switch_trigger,],
    exposes: [e.temperature().withEndpoint('l1'),
      e.temperature().withEndpoint('l2'),
      e.temperature().withEndpoint('l3'),
      e.illuminance_lux().withEndpoint('l4'),
],
    meta: {
        multiEndpoint: true,
        
    },
    endpoint: (device) => {
        return {
            l1: 1, l2: 2, l3: 3, l4: 4,
        };
    },
    icon: 'data:image/png;base64,',
    configure: async (device, coordinatorEndpoint, logger) => {
            const endpoint = device.getEndpoint(1);
      await endpoint.read('genBasic', ['modelId', 'swBuildId', 'powerSource']);
    },

};

module.exports = device;
